import './App.css';
import AddProduct from './frontend/add_product';
import { Router, Route, R  } from 'react-router-dom';
import ProductList from './frontend/product_list';

function App() {
  return (
    <div>
   <Router>
     <Routes>
      <Route exact path="/add_product" component={<AddProduct/>} />
      <Route exact path="/product_list" component={<ProductList/>} />
      </Routes>

  </Router>

    </div>
  );
}

export default App;
